import React from 'react';
import {css} from "@emotion/css";



const  AboutHeroSection = css`
    width: 100%;
  background: #000;
  height: auto;
  .AboutHeroSectionTitle{
    width: 80%;
    position: relative;
    margin: 0 auto;
    & h1 {
      font-family: 'Circe' ,sans-serif;
      font-style: normal;
      font-weight: 400;
      font-size: 36px;
      text-transform: uppercase;
      color: #FFFFFF;
      padding-top: 5%;
      padding-bottom: 14%;
      @media (max-width: 425px){
        font-size: 24px;
      }
    }
  }
`
const Index = () => {
    return (
        <div className={AboutHeroSection}>
            <div className="container">
                <div className="AboutHeroSectionTitle">
                    <h1>О компании</h1>
                </div>
            </div>
        </div>
    );
};

export default Index;
